import './App.css';
import PageLayout from "./components/pageLayout/PageLayout";


const theme = createTheme({
	palette: {
		primary: {
			main: '#3f51b5',
		},
		secondary: {
			main: '#f50057',
		},
		disabled: {
			main: "#56595c",
		}
	},
});

function App() {


	return (
		<ThemeProvider theme={theme}>
			<PageLayout />
		</ThemeProvider>
	);
}

export default App;
